import React from 'react';
import data from './data/scores.json'

const minimumSubs = 3;
const maximumSubs = 24;

function JsonProcessor() {
    for(var i = 0; i < data.length; i++){
      var name = data[i];
      if(name.submissions.length > minimumSubs) { // We've got to rule out submissions less than 3.
          console.log(name.name + " " + name.submissions.length);
          var array = name.submissions;
          var scoreTotal = [];

          for(var j = 0; j < array.length; j++){
            var scores = array[j];
            scoreTotal.push(scores.score);
        }
        accumulateScores(scoreTotal);
      }
    }
  return (
    <div>...</div>
  );
}

function accumulateScores(array){
  for(var k = 0; k < array.length; k++){
    array.sort(function(a,b) { // Sorting arrays
      return b - a;
    });
    for(var m = 0; (m < array.length || m <= maximumSubs); m++){
      console.log(array[m]);
    }
  }
}


export default JsonProcessor;
